-- See DeferredLightsGL4config.lua
-- and DeferredLightsGL4WeaponsConfig.lua

---@alias Light PointLight|ConeLight|BeamLight

---@class LightBaseClass
---@field pieceName string?
---@field yOffset number?
---@field fraction integer? (1, int::max] effect occurs randomly, p = 1/fraction

---@class PointLight : LightBaseClass
---@field lightType "point"
---@field lightConfig PointLightConfig

---@class ConeLight : LightBaseClass
---@field lightType "cone"
---@field lightConfig ConeLightConfig

---@class BeamLight : LightBaseClass
---@field lightType "beam"
---@field lightConfig BeamLightConfig

---@class LightBaseConfig
---@field pos xyz? (default = `{0, 0, 0}`)
---@field rgba float4? [0, 1] (default = `{0, 0, 0, 0}`)
---@field modelfactor number? [0, 2] How much light is applied to models vs. terrain (default `1`)
---@field specular number? [0, 2] Strength of the light's specular highlight (default `1`)
---@field scattering number? [0, 2] Strength of the light's atmospheric scatter (default `1`)
---@field lensflare number? [0, 20] Strength of the light's lens flare effect (default `1`)
---@field lifetime integer? [0, math.huge] Total duration of the light, in frames (default `0`)
---@field sustain number? [0, 1] Time spent at starting brightness, in frames (default `1`)
---@field selfshadowing number? [0, 1] 0 := ?, 1 := screen space (default `0`)

---@class PointLightConfig : LightBaseConfig
---@field color2 float3? [0, 1] (default = `{0, 0, 0}`)
---@field colortime number? in seconds (default = `0`)

---@class ConeLightConfig : LightBaseConfig
---@field dir float3? (default = `{0, 0, 0}`)
---@field theta number? half-angle in radians (default = `0.5`)

---@class BeamLightConfig : LightBaseConfig
---@field pos2 float3? [0, 1] (default = `{0, 0, 0}`)

