-- Duplicate lights across units.

for unitName, copyFrom in pairs {
	armtorps   = "armmls",
	armshltxuw = "armshltx",
	corgantuw  = "corgant",
	armdecom   = "armcom",
	cordecom   = "corcom",
	armcomcon  = "armcom",
	corcomcon  = "corcom",
	armdf      = "armfus",
	armuwfus   = "armfus",
	armckfus   = "armfus",
	legdecom   = "legcom",
} do
	-- Handle options and tweaks that may remove some units:
	if UnitDefNames[unitName] and unitLights[copyFrom] then
		unitLights[unitName] = table.copy(unitLights[copyFrom])
	end
end

local function copy(tbl)
	if type(tbl) == "table" then
		return table.copy(tbl) -- would err on nil
	end
end

for name, copyFrom in pairs {
	armcomlvl10 = "armcom",
	armcomlvl2 = "armcom",
