	if UnitDefNames[unitName] and unitLights[copyFrom] then
		unitLights[name] = copy(unitLights[copyFrom])
		unitEventLightsNames.UnitDecloaked[name] = copy(unitEventLightsNames.UnitDecloaked[copyFrom])
		unitEventLightsNames.UnitIdle[name] = copy(unitEventLightsNames.UnitIdle[copyFrom])
		unitEventLightsNames.UnitScriptLights[name] = copy(unitEventLightsNames.UnitScriptLights[copyFrom])
	end
